    /// <summary>
    ///   Oxford Parkinson's Disease Detection Dataset.
    /// </summary>
    /// 
    /// <remarks>
    /// <para>
    ///   This dataset is composed of a range of biomedical voice measurements from 
    ///   31 people, 23 with Parkinson's disease (PD). Each column in the table is a 
    ///   particular voice measure, and each row corresponds one of 195 voice
    ///   recording from these individuals("name" column). The main aim of the data
    ///   is to discriminate healthy people from those with PD, according to "status" 
    ///   column which is set to 0 for healthy and 1 for PD. </para>
    ///   
    /// <para>
    ///   References:
    ///   <list type="bullet">
    ///     <item><description><a href="https://archive.ics.uci.edu/ml/datasets/parkinsons">
    ///       Lichman, M. "UCI Machine Learning Repository - Parkinsons Data Set."
    ///       Irvine, CA: University of California, School of Information and Computer Science, 2013</a>
    ///       </description></item>
    ///    </list></para>
    /// </remarks>
    /// 
    public class Parkinsons
    {
        /// <summary>
        ///   Gets the data instance features contained in Oxford Parkinson's Disease Detection Dataset.
        /// </summary>
        /// 
        public double[][] Features { get; private set; }

        /// <summary>
        ///   Gets identifiers for each of the instances contained in Oxford Parkinson's Disease Detection Dataset.
        /// </summary>
        /// 
        public string[] InstanceIds { get; private set; }

        /// <summary>
        ///   Gets the class labels associated with each <see cref="Features">instance</see>
        ///   in Oxford Parkinson's Disease Detection Dataset.
        /// </summary>
        /// 
        public int[] ClassLabels { get; private set; }

        /// <summary>
        ///   Gets the class labels in Wisconsin's (Diagnostic) Breast Cancer dataset.
        ///   "Benign", "Malignant".
        /// </summary>
        /// 
        public string[] ClassNames { get; private set; }

        /// <summary>
        ///   Gets the variable names in Oxford Parkinson's Disease Detection data set: 
        ///   MDVP:Fo(Hz) - Average vocal fundamental frequency,
        ///   MDVP:Fhi(Hz) - Maximum vocal fundamental frequency,
        ///   MDVP:Flo(Hz) - Minimum vocal fundamental frequency,
        ///   MDVP:Jitter(%) - Measures of variation in fundamental frequency,
        ///   MDVP:Jitter(Abs) - Measures of variation in fundamental frequency,
        ///   MDVP:RAP - Measures of variation in fundamental frequency,
        ///   MDVP:PPQ - Measures of variation in fundamental frequency,
        ///   Jitter:DDP - Measures of variation in fundamental frequency,
        ///   MDVP:Shimmer - Several measures of variation in amplitude,
        ///   MDVP:Shimmer(dB) - Several measures of variation in amplitude,
        ///   Shimmer:APQ3 - Several measures of variation in amplitude,
        ///   Shimmer:APQ5 - Several measures of variation in amplitude,
        ///   MDVP:APQ - Several measures of variation in amplitude,
        ///   Shimmer:DDA - Several measures of variation in amplitude,
        ///   NHR,HNR - Two measures of ratio of noise to tonal components in the voice,
        ///   RPDE,D2 - Two nonlinear dynamical complexity measures,
        ///   DFA - Signal fractal scaling exponent,
        ///   spread1 - Nonlinear measures of fundamental frequency variation,
        ///   spread2 - Nonlinear measures of fundamental frequency variation,
        ///   PPE - Nonlinear measures of fundamental frequency variation,
        /// </summary>
        /// 
        public string[] VariableNames { get; private set; }

        /// <summary>
        ///   Gets the number of inputs (input dimension) in this dataset (should be 22).
        /// </summary>
        /// 
        public int NumberOfInputs { get { return VariableNames.Length; } }

        /// <summary>
        ///   Gets the number of classes in this dataset (should be 2).
        /// </summary>
        /// 
        public int NumberOfClasses { get { return ClassLabels.Length; } }

